import React from "react";

const ItemCard = ({ image }) => {
  return (
    <div className="image-container">
      <img
        src={image.Poster !== "N/A" ? image.Poster : placeholder}
        alt={image.Title}
      />
    </div>
  );
};

export default ItemCard;
